import { USERS_API_URL } from '../utils/index';
import React, { Component } from 'react';

class TestData extends Component { // 3


  state = {
    items: []
  }

  componentDidMount() {
    this.getItems();
  }

  getItems = () => {
    fetch(USERS_API_URL)
      .then(res => res.json())
      .then(res => this.setState({ items: res }))
      .catch(err => console.log(err));
  }

  render() {
    return <div style={{ paddingTop: "100px" }}>

          <section
            items={this.state.items}
         />
         <div>
         {this.state.items.map(item => <div>{item.name}</div>)}
         </div>

    </div>;
  }
}
export default TestData; // 8
